import React, { useEffect, useState } from "react";
import axios from "axios";

const Episodes = () => {
  const [episodes, setEpisodes] = useState([]);

  const fetchData = () => {
    return axios
      .get("https://api.sampleapis.com/futurama/episodes")
      .then(({ data }) => {
        return data;
      })
      .catch((error) => {
        return error;
      });
  };

  useEffect(() => {
    fetchData().then((data) => {
      setEpisodes(data);
    });
  }, []);

  console.log(episodes);
  return <div>{episodes}</div>;
};

export default Episodes;

// https://api.sampleapis.com/futurama/episodes
